l&gt;\n\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\ndef main():\n    client = Client(n_workers=10, threads_per_worker=1)\n    print(client)\n\n    df = dask.datasets.timeseries(\n        start=\"2000-01-01\",\n        end=\"2000-01-31\",\n        # end=\"2000-12-31\",\n        partition_freq=\"1h\",\n        freq=\"60s\",\n    )\n    df = df.persist()\n    wait(df)\n    iterations = 10\n\n    with performance_report(filename=f\"{today}-simple-scheduler.html\"):\n        simple = []\n        # print('start simple: ', flush=True)\n        for i in range(iterations):\n            start = time.time()\n            z = df.x + 1 + 2 - df.y\n            z.sum().compute()\n            stop = time.time()\n            simple.append(stop - start)\n        simple = np.array(simple)\n\n    df2 = None\n    with performance_report(filename=f\"{today}-shuffle-scheduler.html\"):\n        shuffle_t = []\n        # print('start shuffle: ', flush=True)\n        for i in range(iterations):\n            client.cancel(df2)\n            start = time.time()\n            # shuffle(df, \"id\", shuffle=\"tasks\")\n            df2 = df.set_index(\"id\").persist()\n            wait(df2)\n            stop = time.time()\n            shuffle_t.append(stop - start)\n        shuffle_t = np.array(shuffle_t)\n\n    with performance_report(filename=f\"{today}-rand-access-scheduler.html\"):\n        rand_access = []\n        for i in range(iterations):\n            start = time.time()\n            df2.head()\n            stop = time.time()\n            rand_access.append(stop - start)\n        rand_access = np.array(rand_access)\n    data = dsa.random.random((10000, 1000000), chunks=(1, 1000000))\n    da = xr.DataArray(data, dims=['time', 'x'],\n                      coords={'day': ('time', np.arange(10000) % 100)})\n    clim = da.groupby('day').mean(dim='time')\n    anom = da.groupby('day') - clim\n    anom_mean = anom.mean(dim='time')\n    with performance_report(filename=f\"{today}-anom-mean-scheduler.html\"):\n        anom_mean_t = []\n        for i in range(iterations):\n            start = time.time()\n            anom_mean.compute()\n            stop = time.time()\n            anom_mean_t.append(stop-start)\n\n        anom_mean_t = np.array(anom_mean_t)\n\n    return dict(simple=simple, shuffle=shuffle_t, rand_access=rand_access,\n            anom_mean=anom_mean_t)\n\n        &lt;/pre&gt;\n        "},"id":"1210","type":"Div"},{"attributes":{},"id":"1003","type":"DataRange1d"},{"attributes":{"axis":{"id":"1190"},"ticker":null},"id":"1193","type":"Grid"},{"attributes":{},"id":"1086","type":"BasicTicker"},{"attributes":{},"id":"1244","type":"CategoricalTickFormatter"},{"attributes":{"below":[{"id":"1158"}],"center":[{"id":"1160"},{"id":"1163"}],"left":[{"id":"1161"}],"name":"bandwidth_worker_heatmap","renderers":[{"id":"1168"}],"right":[{"id":"1170"}],"sizing_mode":"stretch_both","title":{"id":"1148"},"toolbar":{"id":"1164"},"toolbar_location":null,"x_range":{"id":"1150"},"x_scale":{"id":"1154"},"y_range":{"id":"1152"},"y_scale":{"id":"1156"}},"id":"bk-bandwidth-worker-plot","subtype":"Figure","type":"Plot"},{"attributes":{"source":{"id":"1071"}},"id":"1103","type":"CDSView"},{"attributes":{"below":[{"id":"1081"}],"center":[{"id":"1084"},{"id":"1088"}],"left":[{"id":"1085"}],"renderers":[{"id":"1102"}],"sizing_mode":"stretch_both","title":{"id":"1222"},"toolbar":{"id":"1094"},"x_range":{"id":"1073"},"x_scale":{"id":"1077"},"y_range":{"id":"1075"},"y_scale":{"id":"1079"}},"id":"1072","subtype":"Figure","type":"Plot"},{"attributes":{"high":1,"low":0,"palette":["#ffffFF","#fefeFF","#fdfdFF","#fcfcFF","#fbfbFF","#fafaFF","#f9f9FF","#f8f8FF","#f7f7FF","#f6f6FF","#f5f5FF","#f4f4FF","#f3f3FF","#f2f2FF","#f1f1FF","#f0f0FF","#efefFF","#eeeeFF","#ededFF","#ececFF","#ebebFF","#eaeaFF","#e9e9FF","#e8e8FF","#e7e7FF","#e6e6FF","#e5e5FF","#e4e4FF","#e3e3FF","#e2e2FF","#e1e1FF","#e0e0FF","#dfdfFF","#dedeFF","#ddddFF","#dcdcFF","#dbdbFF","#dadaFF","#d9d9FF
